(62368, '11.1.7 Lorewalking - New Spawn Player Clone Function (LAS)', '-- to fix bug: https://t2jira.corp.blizzard.net/browse/WOW11-131939\n--Tirisfal Glades - \"Lorewalking: The Blade and the High Priest\" (QID84371): Druid Shapeshift forms display during \"Blade in Twilight\" Real Time Cutscene\n--introduced in Lorewalking because non-priests could trigger this cutscene\n--needed to replace the spawn function in the cinematic framework with one that includes useNativeVisual\n\n-- SmoothPhaseSpawnActivePlayerCloneActor( x, y, z, facing [default 0], scale [default 1] )\n--   Spawn an uninteractible actor cloned from the active player adapted for smooth phasing\n--NOTE: DOES NOT WORK, DO NOT USE!!!!!!!!!!!!!! Player models can never smooth phase.\n--NOTE NOTE: i\'m just using it to fix this bug since it\'s most the OG function. Don\'t expect smooth phasing to work. \nfunction UpdatedSmoothPhaseSpawnActivePlayerCloneActor( x, y, z, facing, scale, snapToGround, useNativeVisual )\n\tif not facing then\n\t\tfacing = 0\n\tend\n\n\tif not scale then\n\t\tscale = 1\n\tend\n\n\tlocal spawnPos = Vector:New( x, y, z )\n\tlocal spawnTransform = Transform:New( spawnPos, facing )\n\n\tlocal clonesAvailable = true\n\tlocal creatureID = 0\n\tif (not Scene.SpawnActivePlayerCloneActor) then\n\t\tclonesAvailable = false\n\t\tcreatureID = 65247 -- backup clone creature\n\tend\n\n\tlocal createData = ActorCreateData:New( creatureID, spawnTransform, scale )\n\tcreateData.groundSnap = (snapToGround ~= false)\n\tcreateData.interactible = false\n\tcreateData.smoothPhase = true\n\n\tlocal actor = nil\n\tif (clonesAvailable == true ) then\n\t\tactor = scene:SpawnActivePlayerCloneActor( createData, useNativeVisual )\n\tend\n\n\tif (not actor) then\n\t\tactor = scene:SpawnActor( createData )\n\tend\n\n\tactor:SetInteractible( false )\n\tWaitForSmoothPhase( createData )\n\n\treturn actor\n\nend\n', 61609),
(13954, '[1] 7.0 Artifacts - Acquisition -  Looting Template - Functions - LWB', 'end\n\telse\n\t--\tBroadcast(\"GOING RIGHT\")\n\t\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\tSetCameraFollowPath( genericFOV45, 2, 16354, 14837, 3)\n\t\t\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\t\tSetCameraFollowPath( genericFOV90, 2, 16283, 16360, 3)\n\t\t\t\telse --Everyone Else\n\t\t\t\tSetCameraFollowPath( genericFOV60, 2, 16283, 16360, 3)\n\t\t\tend\n\t\tWait(0.5)\n\t\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\tSetCameraFollowPath( genericFOV45, 3, 16356, 16361, 6.5)\n\t\t\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\t\tSetCameraFollowPath( genericFOV90, 3, 16356, 16360, 6.5)\n\t\t\t\telse --Everyone Else\n\t\t\t\tSetCameraFollowPath( genericFOV60, 3, 16356, 16360, 6.5) \n\t\t\tend\n\tend\n\n\t-- Set Cast Visual Kit Here\n\tlocal castvisual = clone:PlaySpellCastVisual(CASTVISUALID)\n\t\n\tWait(0.5)\n\n\t-- Set AnimKit to PlayLoopingAnimKit\n\tif WEAPONTYPE == 1 then\n\t\tclone:PlayLoopingAnimKit(8527) -- MAIN HAND\n\telseif WEAPONTYPE == 2 then\n\t\tclone:PlayLoopingAnimKit(8529) -- DUAL\n\telseif WEAPONTYPE == 3 then\n\t\tclone:PlayLoopingAnimKit(8530) -- FISTS\n\telseif WEAPONTYPE == 4 then\n\t\tclone:PlayLoopingAnimKit(10671) -- GUN\n\telse\n\t\tclone:PlayLoopingAnimKit(10381) -- SHIELD\n\tend\n\n\tWait(1)\n\n\t--- Set Spell Visual Kit ---\n\tlocal impactvisual = clone:PlaySpellImpactVisual(IMPACTVISUALID) -- SPELL VISUAL IMPACT DURING ANIMATION LOOP\n\tlocal statevisual = clone:PlaySpellStateVisual(STATEVISUALID) --SPELL STATE VISUAL DURING ANIMATION LOOP\n\tclone:PlaySoundKitStereo(PLAYSOUNDID, true ) -- SOUND KIT DURING SPELL VISUAL IMPACT\n\n\t-- TITLE TEXT SPLASH VFX ENABLE --\n\tif scene:EvalPlayerCondition(37486) then\n\t\tcreateSplashData.transform = EFFECTLOCATIONSMALL\n\telseif scene:EvalPlayerCondition(37487) then\n\t\tcreateSplashData.transform = EFFECTLOCATIONBIG\n\telse\n\t\tcreateSplashData.transform = EFFECTLOCATIONMED\n\tend\n\n\tcreateSplashData.modelFileID = splashEffectIDs[WEAPONEFFECT]\n\tcreateSplashData.scale = EFFECTSCALE\n\tSplash = scene:SpawnActor( createSplashData )\n\t\n\tif TEXTEFFECTANIM then\n\t\tSplash:PlayOneShotAnimKit(TEXTEFFECTANIM)\n\tend\n\n\tWait(1)\n\n\t-- Set up Text Name\n\tlocal effect7 = nil\n\teffect7 = clone:CreateTextEffect( GetGlobalString( WEAPONTEXT ) , 1, 0)\n\tclone:SetTextEffectScale(effect7, 1);\n\t\n\t-- Set up Optional Subtext\n\tlocal effect8 = nil\n\tif WEAPONSUBTEXT == 1 then\n\t\teffect8 = clone:CreateTextEffect( GetGlobalString( SECONDWEAPONTEXT ) , 1, 0)\n\t\tclone:SetTextEffectScale(effect8, 0.75);\n\tend\n\n\n\t-- REMOVE TITLE SPLASH VFX\n\tSplash:Fade(0,1)\n\tSplash:Despawn()\n\n\t-- Text Height Check based on race\n\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\tclone:SetTextEffectTransform(effect7, TEXTSMALL); \n\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\tclone:SetTextEffectTransform(effect7, TEXTBIG); \n\telse --Every other race\n\t\tclone:SetTextEffectTransform(effect7, TEXTMED); \n\tend\n\n\t-- Optional Text Height Check based on race\n\tif WEAPONSUBTEXT == 1 then\n\t\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\t\tclone:SetTextEffectTransform(effect8, SECONDTEXTSMALL); \n\t\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\t\tclone:SetTextEffectTransform(effect8, SECONDTEXTBIG); \n\t\telse --Every other race\n\t\t\tclone:SetTextEffectTransform(effect8, SECONDTEXTMED); \n\t\tend\n\tend\n\n\t-- FADE OUT SCREEN EFFECT & CLEANUP\n\tWait(4)\n\tscene:ApplyScreenEffect( 827 )\n\tFadeOut(clone, 1)\n\tWait(1)\n\t-- Clear Visuals\n\tclone:ClearSpellVisual( statevisual)                   \n\n\tscene:SetCamera(0, 0, nil, nil)\n\tWait(1)\n\tclone:ClearTextEffect(effect7);\n\t\n\tif WEAPONSUBTEXT == 1 then\n\t\tclone:ClearTextEffect(effect8);\n\tend\n\t\n\tscene:EndScene()\n\nend', 61609),
(13952, '7.0 Artifacts - Acquisition -  Looting Template - Functions - LWB', '--[[\nThese are the variables that need to be initialized in order to use the cutscene generator\n\nISLEFT \t\t\t- INTEGER - 0 for circling to the RIGHT, 1 for left\nINITSOUNDID \t- INTEGER - ID of soundkit to be played at the beginning of the scene\nCASTVISUALID \t- INTEGER - ID of spell visual that occurs at the beginning of the scene\nIMPACTVISUALID \t- INTEGER - ID of spell visual that occurs during the animation\nSTATEVISUALID \t- INTEGER - ID of spell visual for the state of the scene\nPLAYSOUNDID \t- INTEGER - ID of sound kit that plays when the weapon is actually brandished\nWEAPONID \t\t- INTEGER - ID of the item itself (weapon to brandish)\nWEAPONIDOFFHAND - INTEGER - ID of offhand item (if there is one)\nWEAPONTYPE \t\t- INTEGER - What kind of weapon is being brandished\n\t1 - Single or two handed\n\t2 - Dual Weapons\n\t3 - Fists\n\t4 - Bow/Gun\n\t5 - Shield\nWEAPONEFFECT - INTEGER - What kind of effect to be played when the weapon\'s text appears\n\t1 - Fel\n\t2 - Fire\n\t3 - Ice\n\t4 - Arcane\n\t5 - Holy\n\t6 - Shadow\n\t7 - Lightning\nEFFECTLOCATIONSMALL - Transform:New(Vector:New(x, y, z), rot) - Where the weapon effect splash is played (should be on the text)\nEFFECTLOCATIONBIG - \" \" - If race = tauren\nEFFECTLOCATIONMED - \" \" - If Race is not small or big\nEFFECTSCALE - INTEGER - Size of the effect\n\t\nWEAPONTEXT - STRING - Name of the weapon\nTEXTSMALL - Transform:New(Vector:New(x, y, z), rot) - location of the text based on being small (gnome/goblin/etc)\nTEXTBIG - \" \" - location based on being Tauren\nTEXTMED - \" \" - location based on being everyone else\n\nTEXTEFFECTANIM = animkit for text splash effect\n\n]]--\n\nfunction PlayWeaponScene()\n\t--local ISLEFT = _ISLEFT or 0\n\n\t-- Setup base scene stuff\n\tlocal genericFOV90 = 368\n\tlocal genericFOV60 = 369\n\tlocal genericFOV45 = 370\n\tscene:SetRelativeCoords(true)\n\tscene:SetFadeRegion(200, true)\n\tscene:AddFadeRegionExcludedGameObject(248560)\t--Arcane mage object exclusions\n\tscene:AddFadeRegionExcludedGameObject(248561)\t--Arcane mage object exclusions\n\tscene:AddFadeRegionExcludedGameObject(248559)\t--Arcane mage object exclusions\n\tscene:AddFadeRegionExcludedGameObject(248558)\t--Arcane mage object exclusions\n\tscene:AddFadeRegionExcludedGameObject(249815)\t--Arcane mage object exclusions\n\tclone = UpdatedSmoothPhaseSpawnActivePlayerCloneActor(0, 0, 0, 0, 1, true , true)\n\n\n\t-- Equip clone with the right weapon\n\tif (WEAPONTYPE == 1) then\n\t\tclone:EquipWeapon(WeaponSlot.MainHand, WEAPONID)\n\t\tclone:EquipWeapon(WeaponSlot.OffHand, WEAPONIDOFFHAND)\n\tend\n\tif (WEAPONTYPE == 4) then\n\t\t--clone:EquipWeapon(WeaponSlot.MainHand, 0)\n\t\t--clone:EquipWeapon(WeaponSlot.OffHand, 0)\n\t\t--clone:EquipWeapon(WeaponSlot.MainHand, WEAPONID)\n\t\tclone:EquipWeapon(WeaponSlot.Ranged, WEAPONID)\n\t\tclone:SetSheatheState(SheatheState.ShowRanged, true)\n\tend\n\tif ((WEAPONTYPE == 2) or (WEAPONTYPE == 3) or (WEAPONTYPE == 5)) then\n\t\tclone:EquipWeapon(WeaponSlot.MainHand, WEAPONID)\n\t\tclone:EquipWeapon(WeaponSlot.OffHand, WEAPONIDOFFHAND)\n\tend\n\t\n\t\n\t-- Play Initial Sound\n\tclone:PlaySoundKitStereo(INITSOUNDID, true )\n\n\t-- Choose Left or Right Camera Path\n\tif ISLEFT == 1 then\n\t--\tBroadcast(\"GOING LEFT\")\n\t\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\tSetCameraFollowPath( genericFOV45, 2, 16353, 16365, 3)\n\t\t\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\t\tSetCameraFollowPath( genericFOV90, 2, 14835, 16364, 3)\n\t\t\t\telse --Everyone Else\n\t\t\t\tSetCameraFollowPath( genericFOV60, 2, 14835, 16364, 3)\n\t\t\tend\n\t\tWait(0.5)\n\t\tif scene:EvalPlayerCondition(37486) then -- if gnome, dwarf, or goblin\n\t\tSetCameraFollowPath( genericFOV45, 3, 16355, 16365, 6.5)\n\t\t\telseif scene:EvalPlayerCondition(37487) then -- if Tauren\n\t\t\tSetCameraFollowPath( genericFOV90, 3, 16355, 16364, 6.5)\n\t\t\t\telse --Everyone Else\n\t\t\t\tSetCameraFollowPath( genericFOV60, 3, 16355, 16364, 6.5) \n\t\t\t', 61609);
